INSERT INTO `housedeal` VALUES (34229012,3000,65,'20.07','고층/15층','오픈형 원룸','True','?역세권 오피스텔  도보2분 가능 보증금 저렴한 월세?','❤️방 정보❤️\n\n\n▶ 위치 - [서울대입구역 도보 1분 거리]\n▶ 옵션 - [에어컨,세탁기,냉장고,인덕션 등 풀옵션]\n▶ 특징 - [전세자금대출가능,임대인 보증보험 가입,초역세권]\n23년 2월말 입주가능\n\n\n✔주변환경\n- 서울대입구역 도보 1분, 샤로수길 등등 편의시설\n\n\n✔보안상태\n- 건물 실내외 CCTV  및 현관 도어락 설치, 사설경비\n\n✔특징\n- 융자금 0원 완전 안전한 건물,역에서 도보 1분거리\n- 임대사업자라서 보증보험 필수가입\n- 생각보다넓은원룸으로 혼자 살기에 매우넉넉합니다.\n- 1금융권 활용, 전세자금대출OK(중소기업,버팀목 등)\n22.11.22에 직방에 등록된 매물입니다.','2022-11-22','https://zigbang.com/home/oneroom/items/34229012','서울대입구역(2호선), 낙성대역(2호선), 봉천역(2호선)'),(34214372,200,25,'23.14','2층','오픈형 원룸','False','\"사이즈최고?\"지상층모든게포함된 마지막방?','---------------?매물정보?---------------\n❓ 이 매물은 실매 인가요??\n→ 100% 직접 찍은 실사진입니다 !!\n❓ 보증금 월세 조절이 가능한가요?\n→ 보증금 및 월세 조절 손님에게 최대한 맞춰드리겠습니다 !!\n❓ 역까지는 얼마나 걸리나요??\n→ 봉천역 8분 이내로 갈 수 있는 역세권입니다 !!\n❓ 집은 안전한가요??\n→ 전자도어락 및 건물내외 주변 CCTV 설치로 인해 안전합니다 !!\n❓ 주변의 시설은 어떻게 되어있나요??\n→ 은행, 음식점, 마트, 편의점, 세탁소 등의 주변에 완벽한 편의시설이 있습니다 !!\n❓ 옵션은 어떻게 되어있나요??\n→ 필수 옵션 에어컨, 세탁기, 냉장고, 싱크대 필수 옵션이 완비가 되어있고 수납공간이 좋아 공간 활용 하기가 좋습니다!\n→ ,LED,전구,협탁,러그,이불,책등,모형꽃,와인병 옵션에 포함되어있지 않습니다.\n\n22.11.21에 직방에 등록된 매물입니다.','2022-11-21','https://zigbang.com/home/oneroom/items/34214372','봉천역(2호선), 서울대입구역(2호선), 서원역(신림선경전철)'),(34225951,7000,50,'23.14','5층','분리형 원룸','False','평수 정말 좋은 시세대비 좋은 분리형 1.5룸의 역세권매물','?매물 정보 ?\n\n✔허위매물 아닌 100% 정직한 실 매물✔\n\n✔부동산 시스템 오픈으로 투명하게 보여드립니다✔\n\n✔ 입주 시기: ? 12월 31일?  \n\n✔ 주차?: ❤가능❤  월7만원\n\n✔ 위치: 봉천역?도보5분? \n\n✔ 주변환경: 편의점2분(177m),시장 3분 등 각종 편의시설 多多多\n\n✔ 방형태:? 신축의 완전 깔끔한 분리형 1.5룸 사진보신대로 정말 깔끔합니다 ?\n\n✔ 옵션: ❤에어컨, 세탁기, 냉장고, 옷장, 싱크대, 전기인덕션 ❤\n\n\n✔ 이방의 장점: ?역세권 위치? ❤깔끔한 신축급  분리형 1.5룸 ❤ 옵션  채광 굿?\n                     장점만 보이고 단점은 찾기 힘든 원룸 입니다~? \n                     \n\n\n22.11.22에 직방에 등록된 매물입니다.','2022-11-22','https://zigbang.com/home/oneroom/items/34225951','봉천역(2호선), 서울대입구역(2호선), 서원역(신림선경전철)'),(34195958,100,25,'23.14','4층','분리형 원룸','False','?전기세포함?  리모델링 분리형 넓은방','가스비만쓰시는만큼나와요\n창문도2개라 환기및통풍채광 좋습니다\n방이넓어서인기가좋은방\n버스정류장 및 마트도 걸어서3분정도입니다\n분리형구조의넓은방입니다\n22.11